import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    resultImc:{
        flex:1,
        marginTop:15,
        paddingTop:15,
        borderRadius:60,
        alignItems:"center",
        width:"100%",
        color:"#f424ff",
        fontWeight:"bold",
        fontSize:48,

    },
    formaInfo:{
        fontSize:18,
        color:"#f32424",
        fontWeight:"bold",
        alignItems:"center",

    },
    boxShareButton:{
        width:"100%",
        alignItems:"center",
        marginBottom:10,
    },
    shared: {
        backgroundColor:"#142233",
        borderRadius:50,
        paddingBottom:5,
        paddingTop:5,

    },
    sharedText: {
        color:"ffffff",
        fontWeight:"bold",
        paddingHorizontal:30,
    }
    

})
export default styles
